(132, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/09/wordpress-4-6-1-security-and-maintenance-release/''>WordPress 4.6.1 Security and Maintenance Release</a> <span class="rss-date">September 7, 2016</span><div class="rssSummary">WordPress 4.6.1 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.6 and earlier are affected by two security issues: a cross-site scripting vulnerability via image filename, reported by SumOfPwn researcher Cengiz Han Sahin; and a path traversal vulnerability in [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://poststatus.com/wordpress-theme-anyway-draft-podcast/''>Post Status: What is a WordPress theme anyway? — Draft podcast</a></li><li><a class=''rsswidget'' href=''http://heropress.com/essays/endless-supply-happiness/''>HeroPress: An Endless Supply of Happiness</a></li><li><a class=''rsswidget'' href=''http://heropress.com/essays/a-community-of-acceptance/''>HeroPress: A Community of Acceptance</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Popular Plugin:</span> UpdraftPlus WordPress Backup Plugin&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=updraftplus&amp;_wpnonce=7639d98156&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Install UpdraftPlus WordPress Backup Plugin">(Install)</a></li></ul></div>', 'no'),
