r\r\nwebmaster\r\nsupport\r\nstaff";s:9:"mail_from";s:16:"REDBIO Argentina";s:14:"mail_from_addr";s:27:"info@redbioargentina.org.ar";s:10:"email_html";s:1:"0";s:16:"welcome_email_on";s:1:"1";s:17:"welcome_email_sub";s:25:"Bienvenido a {site_name}!";s:13:"welcome_email";s:322:"Hola {display_name},\r\n\r\nMuchas gracias por asociarse a REDBIO Argentina! Tu cuenta ya está activa.\r\n\r\nPara iniciar sesión podes dirigirte aquí:\r\n\r\n{login_url}\r\n\r\nTu e-mail: {email}\r\nTu nombre de usuario: {username}\r\n\r\nSi se presenta algún problema, por favor contactarnos a: {admin_email}\r\n\r\nGracias,\r\nREDBIO Argentina";s:18:"checkmail_email_on";s:1:"1";s:19:"checkmail_email_sub";s:27:"Por Favor, activa tu cuenta";s:15:"checkmail_email";s:252:"Hola {display_name},\r\n\r\nMuchas gracias por asociarse a REDBIO Argentina!  Para activar tu cuenta debes hacer clic aquí:\r\n{account_activation_link}\r\n\r\nSi se presenta algún problema, por favor contactarnos a: {admin_email}\r\n\r\nGracias,\r\nREDBIO Argentina";s:16:"pending_email_on";s:1:"1";s:17:"pending_email_sub";s:38:"Tu cuenta está pendiente de revisión";s:13:"pending_email";s:273:"Hola {display_name},\r\n\r\nMuchas gracias por asociarse a REDBIO Argentina!  En este momento estamos revisando sus datos.\r\n\r\nNecesitamos un momento para revisar sus datos.\r\n\r\nSi se presenta algún problema, por favor contactarnos a: {admin_email}\r\n\r\nGracias,\r\nREDBIO Argentina";s:17:"approved_email_on";s:1:"1";s:18:"approved_email_sub";s:32:"Su cuenta en REDBIO está activa";s:14:"approved_email";s:381:"Hola {display_name},\r\n\r\nMuchas gracias por asociarse a REDBIO Argentina! Tu cuenta ya está activa.\r\n\r\nPara iniciar sesión podes dirigirte aquí:\r\n\r\n{login_url}\r\n\r\nTu e-mail: {email}\r\nTu nombre de usuario: {username}\r\nBlanquea la clave de usuario aquí: {password_reset_link}\r\n\r\nSi se presenta algún problema, por favor contactarnos a: {admin_email}\r\n\r\nGracias,\r\nREDBIO Argentina";s:17:"rejected_email_on";