(1806, '_transient_dash_c05853b002c443ec8e57ff884f56cdde', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://es.wordpress.org/2016/10/02/slack-wordpress-espana/''>Cómo unirse al Slack de WordPress España</a> <span class="rss-date">02/10/2016</span><div class="rssSummary">La comunidad de WordPress en España usamos Slack para toda la comunicación interna. Gracias a esta herramienta, los equipos de Traducciones, Core, Meetups o WordCamps se pueden coordinar de una manera ágil y colaborativa. El acceso es libre y gratuito; para ello seguiremos los siguientes pasos: Tener una cuenta en los foros de soporte de WordPress.org. Si no la tienes la puedes registrar aquí. Al [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wptavern.com/weglot-multilingual-wordpress-plugin-passes-e10000-in-monthly-revenue''>WPTavern: Weglot Multilingual WordPress Plugin Passes €10,000 in Monthly Revenue</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/wordpress-and-web-development-communities-get-together-to-help-non-profits-at-website-weekend-la''>WPTavern: WordPress and Web Development Communities Get Together to Help Non-Profits at Website Weekend LA</a></li><li><a class=''rsswidget'' href=''https://ma.tt/2016/10/common-at-tiny-desk/''>Matt: Common at Tiny Desk</a></li></ul></div>', 'no'),
