(39, 1, '2016-09-20 17:37:14', '2016-09-20 20:37:14', '[et_pb_section background_color="#132c47" inner_shadow="off" parallax="on"][et_pb_row][et_pb_column type="4_4"][et_pb_divider admin_label="Divider" color="#ffffff" show_divider="off" height="60" /][et_pb_text admin_label="Text" background_layout="dark" text_orientation="center"]<h1 style="font-size: 52px;">Product Features</h1>[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row][et_pb_column type="4_4"][et_pb_image admin_label="Image" src="https://elegantthemesimages.com/images/premade/d2-placeholder-1920.png" url_new_window="off" animation="bottom" show_in_lightbox="off" /][/et_pb_column][/et_pb_row][et_pb_row][et_pb_column type="1_4"][et_pb_blurb admin_label="Blurb" title="Advanced Page Builder" url_new_window="off" animation="top" background_layout="dark" text_orientation="center" use_icon="on" use_circle="on" circle_color="#0d2035" use_circle_border="off" circle_border_color="#2caaca" icon_placement="top" font_icon="" icon_color="#2ea3f2"]Divi will change the way you build websites forever. The advanced page builder makes it possible to build truly dynamic pages without learning code.[/et_pb_blurb][/et_pb_column][et_pb_column type="1_4"][et_pb_blurb admin_label="Blurb" title="Key Elements" url_new_window="off" animation="top" background_layout="dark" text_orientation="center" use_icon="on" use_circle="on" circle_color="#0d2035" use_circle_border="off" circle_border_color="#2caaca" icon_placement="top" font_icon="" icon_color="#2ad4e0"]The builder comes packed with tons of great modules, and more are on the way! Combine and arrange them in any order. The possibilities are countless.[/et_pb_blurb][/et_pb_column][et_pb_column type="1_4"][et_pb_blurb admin_label="Blurb" title="Target Audience" url_new_window="off" animation="top" background_layout="dark" text_orientation="center" use_icon="on" icon_color="#9633e8" use_circle="on" circle_color="#0d2035" use_circle_border="off" circle_border_color="#2caaca" icon_placement="top" font_icon=""]Divi’s layout has been designed with mobile devices in mind. No matter how you use it, and no matter how you view it, your website is going to look great.[/et_pb_blurb][/et_pb_column][et_pb_column type="1_4"][et_pb_blurb admin_label="Blurb" title="Strategy" url_new_window="off" image="https://elegantthemes.com/preview/Divi2/wp-content/uploads/2014/04/blurb-icon-updates.png" animation="top" background_layout="dark" text_orientation="center" use_icon="on" icon_color="#d85fd6" use_circle="on" circle_color="#0d2035" use_circle_border="off" circle_border_color="#2caaca" icon_placement="top" font_icon=""]Divi is here to stay, and you can rest easy knowing that our team will be updating and improving it for years to come. Build on top of a powerful foundation.[/et_pb_blurb][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="off" inner_shadow="off" parallax="off" module_id="builder"][et_pb_row][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center"]<h1>Advanced Drag & Drop Builder</h1>\nThe Divi Builder was made with user experience at the forefront of its priorities. The way it is broken up into sections, rows, columns and widgets, really allows you to understand and edit the structure of your page. Your editing controls are pulled out of the main content area so that you get a clear and concise representation of how your modules fit into your page layout.[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row][et_pb_column type="4_4"][et_pb_image admin_label="Image" src="https://elegantthemesimages.com/images/premade/d2-placeholder-1080px.jpg" url_new_window="off" animation="right" show_in_lightbox="off" /][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="on" specialty="off" inner_shadow="off" parallax="on" module_id="backgrounds"][et_pb_fullwidth_slider admin_label="Fullwidth Slider" show_arrows="on" show_pagination="on" auto="off" parallax="off"][et_pb_slide heading="All The Right Things" background_color="#ffffff" alignment="center" background_layout="dark" background_image="https://elegantthemesimages.com/images/premade/d2-placeholder-1920.png"]Vestibulum lobortis. Donec at euismod nibh, eu bibendum quam. Nullam non gravida purus, nec  eleifend tincidunt nisi.Vestibulum lobortis. Donec at euismod nibh, eu bibendum quam. Nullam non gravida purus, nec  eleifend tincidunt nisi.[/et_pb_slide][/et_pb_fullwidth_slider][/et_pb_section][et_pb_section fullwidth="off" specialty="off" background_color="#283139" inner_shadow="off" parallax="off" module_id="mobile"][et_pb_row][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="dark" text_orientation="center"]\n<h1>Fully Responsive Layouts</h1>\nWe know that your website needs to be accessible and readable on all devices. We made Divi fully responsive so that your designs look great no matter what. With the builder, you design your desktop website, and we make sure that Divi does the heavy lifting for you.\n\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row][et_pb_column type="4_4"][et_pb_image admin_label="Image" src="https://elegantthemesimages.com/images/premade/d2-placeholder-1080px.jpg" url_new_window="off" animation="left" show_in_lightbox="off" /][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="off" specialty="off" inner_shadow="off" parallax="off" module_id="layouts"][et_pb_row][et_pb_column type="1_2"][et_pb_image admin_label="Image" src="https://elegantthemesimages.com/images/premade/d2-placeholder-510px.png" url_new_window="off" animation="right" show_in_lightbox="off" /][/et_pb_column][et_pb_column type="1_2"][et_pb_divider admin_label="Divider" color="#ffffff" show_divider="off" height="70" /][et_pb_cta admin_label="Call To Action" title="Product Feature" button_url="#" button_text="Learn More" use_background_color="off" background_color="#2caaca" background_layout="light" text_orientation="left"]Divi Ships with a tone of great premade layouts to get you started with a homepage, a portfolio, an eCommerce Storefront, and much more! Check out the theme demo to preview a few of these premade layouts. We''ve even realeased layout packs along the way for portfolios and business focused websites.[/et_pb_cta][/et_pb_column][/et_pb_row][et_pb_row][et_pb_column type="1_2"][et_pb_divider admin_label="Divider" color="#ffffff" show_divider="off" height="40" /][et_pb_cta admin_label="Call To Action" title="Product Feature" button_url="#" button_text="Learn More" use_background_color="off" background_color="#2caaca" background_layout="light" text_orientation="right"]Divi Ships with a tone of great premade layouts to get you started with a homepage, a portfolio, an eCommerce Storefront, and much more! Check out the theme demo to preview a few of these premade layouts. We''ve even realeased layout packs along the way for portfolios and business focused websites.[/et_pb_cta][/et_pb_column][et_pb_column type="1_2"][et_pb_image admin_label="Image" src="https://elegantthemesimages.com/images/premade/d2-placeholder-510px.png" url_new_window="off" animation="left" show_in_lightbox="off" /][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section fullwidth="off" specialty="off" background_color="#f74b47" inner_shadow="off" parallax="off"][et_pb_row][et_pb_column type="4_4"][et_pb_cta admin_label="Call To Action" title="Signup Today For Instant Access" button_url="#" button_text="Join Today" use_background_color="off" background_color="#2ea3f2" background_layout="dark" text_orientation="center"]Join today and get access to Divi, as well as our other countless themes and plugins.[/et_pb_cta][/et_pb_column][/et_pb_row][/et_pb_section]', 'Product Features', '', 'publish', 'closed', 'closed', '', 'product-features', '', '', '2016-09-20 17:37:14', '2016-09-20 20:37:14', '', 0, 'http://www.redbioargentina.org.ar/et_pb_layout/product-features/', 0, 'et_pb_layout', '', 0),
