(53, 1, '2016-09-27 15:27:44', '2016-09-27 18:27:44', '[et_pb_section admin_label="Section" fullwidth="on" specialty="off" transparent_background="off" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" disabled="off" disabled_on="on|off|" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][et_pb_fullwidth_header admin_label="Fullwidth Header" title="Registro" subhead="REDBIO Argentina<br /><small>Asociación civil</small>" background_layout="dark" text_orientation="center" header_fullscreen="off" header_scroll_down="on" background_url="http://www.redbioargentina.org.ar/contenido/uploads/header-historia.jpg" parallax="off" parallax_method="off" content_orientation="center" image_orientation="center" custom_button_one="off" button_one_letter_spacing="0" button_one_use_icon="default" button_one_icon_placement="right" button_one_on_hover="on" button_one_letter_spacing_hover="0" custom_button_two="off" button_two_letter_spacing="0" button_two_use_icon="default" button_two_icon_placement="right" button_two_on_hover="on" button_two_letter_spacing_hover="0" scroll_down_icon="%%1%%" background_overlay_color="rgba(0,0,0,0.36)" title_font="|||on|" title_font_size="36px" subhead_font_size="24px"]\r\n\r\n\r\n\r\n[/et_pb_fullwidth_header][/et_pb_section][et_pb_section admin_label="section" transparent_background="off" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][et_pb_row admin_label="row" make_fullwidth="off" use_custom_width="off" width_unit="on" use_custom_gutter="off" padding_mobile="off" disabled="off" disabled_on="|on|on" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h2 class="h2-title">Formulario para estudiantes o profesionales.</h2>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row" make_fullwidth="off" use_custom_width="off" width_unit="on" use_custom_gutter="off" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" parallax_2="off" parallax_method_2="off" column_padding_mobile="on"][et_pb_column type="1_2"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h2 class="h2-title">Formulario de registro</h2>\r\nEste formulario es para profesionales y estudiantes. Formulario para instituciones o empresas, clic <a href="http://www.redbioargentina.org.ar/register-instituciones/">aquí</a>.\r\n\r\n[ultimatemember form_id=126]\r\n\r\n[/et_pb_text][/et_pb_column][et_pb_column type="1_2"][et_pb_accordion admin_label="Accordion" toggle_font="|on||on|" use_border_color="off" border_color="#ffffff" border_style="solid" toggle_font_size="14" saved_tabs="all"]\r\n\r\n[et_pb_accordion_item title="Instruciones"]\r\n<ol>\r\n 	<li>Elija su opción en el cuadro de VALORES transcripto</li>\r\n 	<li>Realice la transferencia bancaria según se detalla más abajo en DATOS BANCARIOS (Los costos de transferencia son a cargo del interesado)</li>\r\n 	<li>Una vez hecha la transferencia bancaria complete el formulario y adjunte el comprobante de pago para poder ser habilitado.</li>\r\n</ol>\r\n[/et_pb_accordion_item][et_pb_accordion_item title="Datos Bancarios"]\r\n<p style="text-align: justify;"><span class="normalTxt">REDBIO DE ARGENTINA ASOCIACION CIVIL </span><span class="bold">Cuenta Banco Provincia de Buenos Aires </span><span class="normalTxt"><strong>Suc. Morón</strong> Cta Cte Nro 0504243 Sucursal 05098 CBU .0140030-4 0150980504243-9 CUIT de REDBIO Argentina 30-70993694-4</span></p>\r\n[/et_pb_accordion_item][et_pb_accordion_item title="Transferencia desde el exterior"]\r\n<p style="text-align: justify;">Para Instrucciones para Transferencias desde el exterior contactar a <a href="http://www.bapro.com.ar/" target="_blank">Banco de la Provincia de Buenos Aires</a>.</p>\r\n[/et_pb_accordion_item][et_pb_accordion_item title="Blanqueo de clave"]\r\n\r\nPara blanqueo de clave haga clic <a href="http://www.redbioargentina.org.ar/password-reset/">aquí</a>.\r\n\r\n[/et_pb_accordion_item]\r\n\r\n[/et_pb_accordion][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title tipo-en-rojo">Categorías:</h3>\r\n<span style="color: #c50000;">Profesional: $ 400.-</span>\r\n<span style="color: #c50000;">Estudiante (grado y post-grado): $300.-\r\n</span><span style="color: #c50000;">Estudiante de Post-grado: $300.-</span>\r\n\r\n<em><strong>Deberá adjuntar el comprobante de pago en este formulario.</strong></em>\r\n\r\n[/et_pb_text][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register-instituciones/" url_new_window="off" button_text="Registro instituciones" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0"]\r\n\r\n\r\n\r\n[/et_pb_button][/et_pb_column][/et_pb_row][/et_pb_section]', 'Register', '', 'publish', 'closed', 'closed', '', 'register', '', '', '2016-10-02 23:01:42', '2016-10-03 02:01:42', '', 0, 'http://www.redbioargentina.org.ar/2016/09/27/register/', 0, 'page', '', 0),
