(60, 2, '2016-09-27 15:52:48', '2016-09-27 18:52:48', 'Post-doctoral Fellow - Cell Cycle and Cancer Biology - Oklahoma City, USA. Roberto Pezza, PhD Job Summary/Basic Function:\r\n\r\nWe are currently accepting applications for positions at the level of postdoctoral fellow. We are developing projects in genetics and biochemistry of the meiotic homologous recombination. We aim to define the molecular mechanisms directing the pre- and postsynaptic events involved in the repair of double strand break through homologous recombination. We are particularly interested in establishing the role of newly indentified proteins in these processes. We offer an excellent research environment and opportunities for career advancement. Our laboratory has a strong expertise and published record in biochemistry, mouse genetics and molecular biology. Minimum Qualifications: Ph.D. or Ph.D./M.D. Preferred Qualifications: A candidate should have a doctoral degree in biochemistry or genetics. We will give priority to applicant with a strong interest and expertise in DNA repair systems and chromosome dynamics in meiosis. Experience with expression cDNA libraries, recombinant protein expression studies, and functional characterization of genes especially in the mouse model will be given preference. Interested individuals should send CV, and reference information to: roberto-pezza@omrf.org', 'Becas Post-Doctorales', 'Se ofrecen becas post- Doctorales en dos Centros de Investigación de Estados Unidos: “Cell Cycle and Cancer Biology Centre” de Oklahoma y “The Huck Institutes of Life Sciences”, de Pennsylvania. Se adjunta información y el e-mail de contacto.', 'publish', 'closed', 'closed', '', 'becas-post-doctorales', '', '', '2016-10-03 23:36:52', '2016-10-04 02:36:52', '', 0, 'http://www.redbioargentina.org.ar/?p=60', 0, 'post', '', 0),
(61, 2, '2016-09-29 15:54:43', '2016-09-29 18:54:43', 'La Fundación Instituto para el Desarrollo Productivo y Tecnológico Empresarial de la Argentina (DPT) conjuntamente con la Cámara de Instituciones de Diagnóstico Médico (CA.DI.ME) y el Centro de Estudios para el Desarrollo de la Industria Químico Farmacéutica Argentina (CEDIQUIFA) concederán el premio al mejor trabajo científico que se presente sobre el tema Aplicaciones de la Biotecnología para la Salud Humana.\r\n\r\nEl trabajo debe presentarse<em> hasta el 31/8/2014</em> a los siguientes emails: <a class="linkGral" href="mailto:cedieduca@cedi.org.ar" target="_blank">cedieduca@cedi.org.ar</a>; <a class="linkGral" href="mailto:cadime@cadime.com.ar" target="_blank">cadime@cadime.com.ar</a>; <a class="linkGral" href="mailto:info@fundaciondpt.com.ar" target="_blank">info@fundaciondpt.com.ar</a>\r\nInformes: <a class="linkGral" href="http://www.cadime.com.ar/" target="_blank">www.cadime.com.ar</a>', '“Premio Fundación – CA.DI.ME - CEDIQUIFA en Biotecnología para la Salud Humana', 'La Fundación Instituto para el Desarrollo Productivo y Tecnológico Empresarial de la Argentina (DPT) conjuntamente con la Cámara de Instituciones de Diagnóstico Médico (CA.DI.ME) y el Centro de Estudios para el Desarrollo de la Industria Químico Farmacéutica Argentina (CEDIQUIFA) concederán el premio al mejor trabajo científico que se presente sobre el tema Aplicaciones de la Biotecnología para la Salud Humana.', 'publish', 'closed', 'closed', '', 'premio-fundacion-ca-di-me-cediquifa-en-biotecnologia-para-la-salud-humana', '', '', '2016-10-03 23:36:46', '2016-10-04 02:36:46', '', 0, 'http://www.redbioargentina.org.ar/?p=61', 0, 'post', '', 0),
(62, 2, '2016-09-27 15:55:56', '2016-09-27 18:55:56', 'El Doctorado Binacional en Ciencia, Tecnología e Innovación, es dictado por las Facultades de Agronomía y Veterinaria y Ciencias Exactas, Físico-Químicas y Naturales de la Universidad Nacional de Río Cuarto y la Universidad Federal Rural do Río de Janeiro - Brasil.\r\n\r\nPara informes, contactarse a Secretaría de Posgrado Facultad de Agronomía y Veterinaria - Te: 00 54 358 4676209/210. Mail: <a class="linkGral" href="mailto:postgrado@ayv.unrc.edu.ar" target="_blank">postgrado@ayv.unrc.edu.ar</a>\r\nSecretaria de Posgrado Facultad de Ciencias Exactas, Físico-Químicas y Naturales Te: 00 54 358 4676431. Mail:<a class="linkGral" href="mailto:postgrado@exa.unrc.edu.ar" target="_blank">postgrado@exa.unrc.edu.ar</a>,<span class="normalTxt">\r\n</span>', 'Carrera de Ingeniería en Agrobiotecnología', 'El Doctorado Binacional en Ciencia, Tecnología e Innovación, es dictado por las Facultades de Agronomía y Veterinaria y Ciencias Exactas, Físico-Químicas y Naturales de la Universidad Nacional de Río Cuarto y la Universidad Federal Rural do Río de Janeiro - Brasil.', 'publish', 'closed', 'closed', '', 'carrera-de-ingenieria-en-agrobiotecnologia', '', '', '2016-10-03 23:38:24', '2016-10-04 02:38:24', '', 0, 'http://www.redbioargentina.org.ar/?p=62', 0, 'post', '', 0),
(63, 2, '2011-05-10 15:57:06', '2011-05-10 18:57:06', '[et_pb_section admin_label="section"][et_pb_row admin_label="row"][et_pb_column type="4_4"][et_pb_text admin_label="Texto" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n<h2 style="text-align: center;">Jornada:\r\nSoja en el Siglo XXI: a 15 años de la aprobación del primer evento transgénico en Argentina.</h2>\r\n<h4 style="text-align: center;">10 de mayo 2011</h4>\r\n<h4 style="text-align: center;">Lic Javier Gilli</h4>\r\n<h5 style="text-align: center;">EEA INTA Marcos Juárez</h5>\r\n<p style="text-align: center;">e-mail: jgilli@mjuarez.inta.gov.ar</p>\r\n<p style="text-align: center;"><em>Salones de la Funcación Cassará, Av de Mayo 1190, C.A.B.A</em></p>\r\n\r\n<h2></h2>\r\n<h2>Ver publicación completa:</h2>\r\n[/et_pb_text][et_pb_button admin_label="Botón" button_url="http://www.redbioargentina.org.ar/contenido/uploads/publicaciones/avancesMapeoGenetico_GenomicaRresistencia.pdf" url_new_window="on" button_text="Descargar aquí" button_alignment="left" background_layout="light" custom_button="on" button_letter_spacing="0" button_use_icon="off" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0" button_text_size="14" button_text_color="#ffffff" button_bg_color="#c50000" button_border_width="0" button_font="|||on|"] [/et_pb_button][/et_pb_column][/et_pb_row][et_pb_row admin_label="Fila" make_fullwidth="off" use_custom_width="off" width_unit="on" use_custom_gutter="off" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on"][et_pb_column type="4_4"][et_pb_divider admin_label="Separador" color="#0080c3" show_divider="on" height="20" divider_style="solid" divider_position="top" hide_on_mobile="off"] [/et_pb_divider][/et_pb_column][/et_pb_row][et_pb_row admin_label="Fila"][et_pb_column type="4_4"][et_p