(64, 2, '2016-04-27 15:57:30', '2016-04-27 18:57:30', '[et_pb_section admin_label="section"][et_pb_row admin_label="row"][et_pb_column type="4_4"][et_pb_text admin_label="Texto" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\nLa biotecnología como herramienta de integración y desarrollo: el BiotecSojaSur.\r\n\r\nLa “Aproximación genómica integrada en el MERCOSUR para la prospección de genes útiles al mejoramiento de la soja frente a estrés biótico y abiótico ” o BiotecSojaSur I, que ya se constituyó en un Laboratorio Virtual llamado BiotecSojaSur.\r\n<h2>Ver publicación completa:</h2>\r\n[/et_pb_text][et_pb_button admin_label="Botón" button_url="http://www.redbioargentina.org.ar/contenido/uploads/publicaciones/BiotecSojaSur.pdf" url_new_window="on" button_text="Descargar aquí" button_alignment="left" background_layout="light" custom_button="on" button_letter_spacing="0" button_use_icon="off" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0" button_text_size="14" button_text_color="#ffffff" button_bg_color="#c50000" button_border_width="0" button_font="|||on|"] [/et_pb_button][/et_pb_column][/et_pb_row][et_pb_row admin_label="Fila" make_fullwidth="off" use_custom_width="off" width_unit="on" use_custom_gutter="off" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on"][et_pb_column type="4_4"][et_pb_divider admin_label="Separador" color="#0080c3" show_divider="on" height="20" divider_style="solid" divider_position="top" hide_on_mobile="off"] [/et_pb_divider][/et_pb_column][/et_pb_row][et_pb_row admin_label="Fila"][et_pb_column type="4_4"][et_pb_text admin_label="Texto" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n<h3 class="h3-title">Novedades</h3>\r\n[/et_pb_text][et_pb_bl