(65, 2, '2016-09-27 15:58:47', '2016-09-27 18:58:47', 'Ya estamos organizando el nuevo simposio del año 2017 que se realizará en Bahía Blanca.\r\n\r\nEstén alertas que se viene lo mejor.\r\n\r\n¿Querés recibir las noticias? Subscribite a nuestro newsletter.', 'Simposio 2017 en Bahía Blanca', 'Ya estamos organizando el nuevo simposio del año 2017 que se realizará en Bahía Blanca. Subscribite a nuestro newsletter para estar al tanto de las últimas noticias.', 'publish', 'closed', 'closed', '', 'simposio-2017-en-bahia-blanca', '', '', '2016-10-03 23:40:25', '2016-10-04 02:40:25', '', 0, 'http://www.redbioargentina.org.ar/?p=65', 0, 'post', '', 0),
(66, 2, '2016-09-27 16:00:15', '2016-09-27 19:00:15', '<blockquote>REDBIO- Argentina invita a sus socios y colegas a participar del "X Simposio Nacional de Biotecnología REDBIO Argentina 2015" que se desarrollará en la ciudad de <strong>San Miguel de Tucumán</strong>, del<strong> 2 al 4 de septiembre </strong>de 2015.</blockquote>\r\nEl Simposio incluirá las siguientes disciplinas: Biotecnología Vegetal, Humana, Animal e Industrial, Bioenergía, Biorremediación, Percepción y Regulatorias. Toda la información relacionada con el evento estará disponible en la pagina web de REDBIO.\r\n<h2>Primera Circular X REDBIO Argentina 2015</h2>\r\nEstimados Colegas, tenemos el agrado de anunciarles la realización del “X Simposio Nacional de Bio tendrá lugar en la ciudad de San Miguel de Tucumán los días Septiembre, en sede a designar. Al igual que en la versión de 2013 se incluirán las siguiente Biotecnologías Vegetal Biorremediación, Percepción y Regulatorias Agende el evento!!!', 'Simposio Nacional de Biotecnología REDBIO Argentina 2015', 'REDBIO- Argentina invita a sus socios y colegas a participar del "X Simposio Nacional de Biotecnología REDBIO Argentina 2015" que se desarrollará en la ciudad de San Miguel de Tucumán, del 2 al 4 de septiembre de 2015. ', 'publish', 'closed', 'closed', '', 'simposio-nacional-de-biotecnologia-redbio-argentina-2015', '', '', '2016-10-03 23:39:01', '2016-10-04 02:39:01', '', 0, 'http://www.redbioargentina.org.ar/?p=66', 0, 'post', '', 0),
(67, 1, '2016-10-25 21:58:35', '2016-10-26 00:58:35', '[et_pb_section admin_label="Section" fullwidth="on" specialty="off"][et_pb_fullwidth_slider admin_label="Fullwidth Slider" show_arrows="on" show_pagination="on" auto="on" auto_ignore_hover="off" parallax="off" parallax_method="off" remove_inner_shadow="off" background_position="default" background_size="default" hide_content_on_mobile="off" hide_cta_on_mobile="off" show_image_video_mobile="off" custom_button="off" button_letter_spacing="0" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0" disabled="off" disabled_on="on||" auto_speed="3000"]\n\n[et_pb_slide heading="RedBio Argentina" button_text="Asociarse" button_link="http://www.redbioargentina.org.ar/asociarse/" background_image="http://www.redbioargentina.org.ar/contenido/uploads/slider-up1.png" background_position="default" background_size="default" background_color="#ffffff" use_bg_overlay="on" use_text_overlay="off" alignment="center" background_layout="dark" allow_player_pause="off" text_border_radius="3" header_font_select="default" header_font="|||on|" body_font_select="default" body_font="||||" custom_button="on" button_font_select="default" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" bg_overlay_color="rgba(0,0,0,0.2)" button_text_color="#ffffff" button_bg_color="#c50000" button_border_width="0" header_font_size="36" header_font_size_tablet="28" header_font_size_phone="24" header_letter_spacing="1px" header_letter_spacing_tablet="1px" header_letter_spacing_phone="1px" header_line_height_tablet="1.1em" header_line_height_phone="1.3em" button_text_size="18" button_text_size_tablet="18" button_text_size_phone="18" header_line_height="1.1em" header_font_size_last_edited="on|tablet" header_line_height_last_edited="on|phone"]\n\n<p></p><h4 style="text-align: center; text-transform: uppercase; margin-bottom: 15px;">Asociación Civil</h4>\n<p>Proporcionamos la capacidad, los servicios y el ambiente necesario, como parte del marco de trabajo de la Red REDBIO/CIAT, para <strong>impulsar, apoyar y ejecutar</strong> el desarrollo de programas y proyectos de biotecnología, <strong>integrando a las instituciones líderes, favoreciendo la sinergia entre la Academia</strong>, el Gobierno y la Industria.</p>\n\n[/et_pb_slide][et_pb_slide heading="XI Simposio nacional de Biotecnología" button_text="Inscribirse" button_link="http://www.redbioargentina.org.ar/simposio2017/" background_image="http://www.redbioargentina.org.ar/contenido/uploads/slider-up2.png" background_position="default" background_size="default" background_color="#ffffff" use_bg_overlay="on" use_text_overlay="off" alignment="center" background_layout="dark" allow_player_pause="off" text_border_radius="3" header_font_select="default" header_font="|||on|" body_font_select="default" body_font="||||" custom_button="on" button_font_select="default" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" bg_overlay_color="rgba(255,255,255,0.46)" button_text_color="#ffffff" button_bg_color="#53a92a" button_border_width="0" header_font_size="36" header_font_size_tablet="24" header_font_size_phone="24" header_letter_spacing="1px" header_letter_spacing_tablet="1px" header_letter_spacing_phone="1px" header_line_height_tablet="1.3em" header_line_height_phone="1.3em" button_text_size="18" button_text_size_tablet="18" button_text_size_phone="18" header_line_height="1.3em" image="http://www.redbioargentina.org.ar/contenido/uploads/logo-2017.png" header_text_color="#0481c2" body_font_size="18" body_font_size_phone="14" header_font_size_last_edited="on|tablet" header_line_height_last_edited="on|phone" body_font_size_last_edited="on|tablet" body_font_size_tablet="18"]\n\n<p><span style="color: #0481c2;">En el año 2017, en Bahía Blanca se está preparando el XII Simposio nacional de Biotecnología. El encuentro será en la ciudad de&nbsp;Bahía Blanca, provincia de Buenos Aires, Argentina. En breve estaremos subiendo más información.</span></p>\n\n[/et_pb_slide]\n\n[/et_pb_fullwidth_slider][et_pb_fullwidth_header admin_label="Fullwidth Header" title="REDBIO ARGENTINA" subhead="Asociación civil" background_layout="light" text_orientation="center" header_fullscreen="off" header_scroll_down="off" parallax="off" parallax_method="off" content_orientation="center" image_orientation="center" disabled="off" disabled_on="|on|on" custom_button_one="off" button_one_letter_spacing="0" button_one_use_icon="default" button_one_icon_placement="right" button_one_on_hover="on" button_one_letter_spacing_hover="0" custom_button_two="off" button_two_letter_spacing="0" button_two_use_icon="default" button_two_icon_placement="right" button_two_on_hover="on" button_two_letter_spacing_hover="0" title_font_size="18px" subhead_font_size="16px"]\n\n<br />\n\n[/et_pb_fullwidth_header][/et_pb_section][et_pb_section admin_label="section"][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid"]\n\n<h2 class="h2-title">Historia</h2>\n\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="row"][et_pb_column type="1_2"][et_pb_text admin_label="Text" background_layout="light" text_orientation="justified" use_border_color="off" border_color="#ffffff" border_style="solid"]\n\n<p>\nLa REDBIO comenzó a gestarse en 1990 cuando la oficina regional de la FAO para Latinoamérica y el Caribe organizó un encuentro entre 173 laboratorios de 17 países. La REDBIO Argentina fue oficialmente establecida en enero de 1991 con el apoyo oficial de la FAO y la cooperación del International Agricultural Research Centers activo en la región. La misma surge para darle seguimiento al éxito obtenido por REDBIO y para permitir la concreción de nuevos emprendimientos en el campo de la Biotecnología Vegetal para América Latina y el Caribe. De esta forma se constituye la Fundación REDBIO Internacional como una Organización No Gubernamental sin fines de lucro, la cual promueve el desarrollo y utilización responsable de la Biotecnología como una herramienta clave para el crecimiento competitivo y sustentable de la producción Agropecuaria y Forestal de la Región.</p>\n\n[/et_pb_text][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/institucional/" url_new_window="off" button_text="Conocer más" button_alignment="left" background_layout="light" custom_button="on" button_text_color="#ffffff" button_bg_color="#339900" button_letter_spacing="0" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0" button_text_size="16" button_border_width="0" button_font="|||on|"]\n\n<br />\n\n[/et_pb_button][/et_pb_column][et_pb_column type="1_2"][et_pb_accordion admin_label="Accordion" toggle_font="|on||on|" use_border_color="off" border_color="#ffffff" border_style="solid" toggle_font_size="14" saved_tabs="all"]\n\n<p>\n[et_pb_accordion_item title="Visión"]\n<p style="text-align: justify;">Construir una organización líder en Argentina que nuclee a instituciones y empresas en biotecnología agrícola con el fin de promover la generación de conocimiento, el desarrollo productivo, el uso racional y sostenible de la biodiversidad, contribuyendo a la modernización e integración de la región en el contexto global, mejorando la calidad de vida de la sociedad en general y de las poblaciones en situación agroalimentaria crítica en particular.</p>\n[/et_pb_accordion_item][et_pb_accordion_item title="Misión"]\n<p style="text-align: justify;">Proporcionar la capacidad, los servicios y el ambiente necesario, como parte del marco de trabajo de la Red REDBIO/FAO, para impulsar, apoyar y ejecutar el desarrollo de programas y proyectos de biotecnología agrícola, integrando a las instituciones líderes, favoreciendo la sinergia entre la Academia, el Gobierno y la Industria y favoreciendo la colaboración y el intercambio de conocimientos con organizaciones internacionales.</p>\n[/et_pb_accordion_item][et_pb_accordion_item title="Objetivos"]\n<p style="text-align: justify;">Impulsar el intercambio de conocimientos, tecnología y materiales biológicos entre las instituciones y organizaciones públicas y privadas de los países de América Latina y el Caribe. Fomentar la enseñanza, el estudio, el uso racional y la conservación de la biodiversidad de la región. Favorecer el desarrollo de proyectos de Investigación y Desarrollo entre institutos, laboratorios y empresas de la región, con entidades similares a nivel mundial. Auspiciar la capacitación técnica y generación de recursos humanos calificados a todo nivel en temas de biotecnología vegetal. Asesorar a los gobiernos, organizaciones regionales e internacionales para la consolidación de estrategias de desarrollo en biotecnología vegetal. Promover políticas nacionales y regionales de desarrollo de biotecnología para los sectores productivos y agroindustriales. Obtener contribuciones nacionales e internacionales para cumplir con sus fines.</p>\n[/et_pb_accordion_item]\n\n[/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section admin_label="Section" fullwidth="off" specialty="off" transparent_background="off" background_color="#0080c3" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="dark" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid"]\n\n<h2 class="h2-title tipo-en-blanco">Ser socio</h2>\n\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="1_3"][et_pb_blurb admin_label="Blurb" title="Sim