(88, 1, '2016-09-27 17:57:20', '2016-09-27 20:57:20', '[et_pb_section admin_label="Section" fullwidth="on" specialty="off" transparent_background="off" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" disabled="off" disabled_on="on|off|" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][et_pb_fullwidth_header admin_label="Fullwidth Header" title="REDBIO Argentina" subhead="Asociación civil" background_layout="dark" text_orientation="center" header_fullscreen="off" header_scroll_down="on" background_url="http://www.redbioargentina.org.ar/contenido/uploads/header-historia.jpg" parallax="off" parallax_method="off" content_orientation="center" image_orientation="center" custom_button_one="off" button_one_letter_spacing="0" button_one_use_icon="default" button_one_icon_placement="right" button_one_on_hover="on" button_one_letter_spacing_hover="0" custom_button_two="off" button_two_letter_spacing="0" button_two_use_icon="default" button_two_icon_placement="right" button_two_on_hover="on" button_two_letter_spacing_hover="0" scroll_down_icon="%%1%%" background_overlay_color="rgba(0,0,0,0.36)" title_font="|||on|" title_font_size="36px" subhead_font_size="24px"]\r\n\r\n\r\n\r\n[/et_pb_fullwidth_header][/et_pb_section][et_pb_section admin_label="Section" fullwidth="off" specialty="on"][et_pb_column type="3_4" specialty_columns="3"][et_pb_row_inner admin_label="Row"][et_pb_column_inner type="4_4" saved_specialty_column_type="3_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h2 class="h2-title">Historia</h2>\r\n\r\n[/et_pb_text][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p style="text-align: justify;">La REDBIO comenzó a gestarse en 1990 cuando la oficina regional de la FAO para Latinoamérica y el Caribe organizó un encuentro entre 173 laboratorios de 17 países. La REDBIO Argentina fue oficialmente establecida en enero de 1991 con el apoyo oficial de la FAO y la cooperación del International Agricultural Research Centers activo en la región. En el año 1998 durante el III Encuentro Latinoamericano de Biotecnología Vegetal los Coordinadores Nacionales de la Red de Cooperación Técnica en Biotecnología Vegetal (REDBIO/FAO) y referentes Latinoamericanos de la Biotecnología Vegetal deciden fundar una Asociación Civil. La misma surge para darle seguimiento al éxito obtenido por REDBIO y para permitir la concreción de nuevos emprendimientos en el campo de la Biotecnología Vegetal para América Latina y el Caribe.\r\nDe esta forma se constituye la Fundación REDBIO Internacional como una Organización No Gubernamental sin fines de lucro, la cual promueve el desarrollo y utilización responsable de la Biotecnología como una herramienta clave para el crecimiento competitivo y sustentable de la producción Agropecuaria y Forestal de la Región.\r\nHoy en día REDBIO congrega a más de 2300 investigadores que trabajan en mas de 643 laboratorios pertenecientes a Centros de I+D, Universidades, así como también pequeñas y medianas empresas en 32 países de América Latina y el Caribe.\r\nLa institución lidera diversas actividades relacionadas a la investigación, formación de recursos humanos y asistencia técnica a los gobiernos en temas ligados a la Biotecnología Agropecuaria. Desde Octubre de 2002, la que se denominó Fundación REDBIO Argentina (FRA) realizó actividades en favor del acercamiento y capacitación en Biotecnología Vegetal en todas las regiones del país.\r\nEn el año 2007 la FRA, ahora REDBIO Argentina Asociación Civil (RAAC), ha conseguido su personería jurídica. La RED cuenta actualmente con más de 70 laboratorios inscriptos y distribuidos en el territorio argentino y cerca de 1100 profesionales, estudiantes, becarios y docentes.\r\nLa Comisión Directiva pro tempore de la filial Argentina está constituida por un grupo de profesionales pertenecientes a REDBIO, contándose a su vez entre los Socios Fundadores y Honorarios, destacados profesionales del área, quienes apoyan la misión y visión de la Fundación REDBIO Argentina (FRAR).\r\nDurante el desarrollo de REDBIO 2009 se realizará el acto de inauguración formal de la REDBIO Argentina Asociación Civil y se llamará a la primer Asamblea General Ordinaria.\r\nLa finalidad de la REDBIO Argentina AC es crear un marco que propicie el acercamiento de los grupos de investigación en biotecnología de la Argentina.</p>\r\n\r\n[/et_pb_text][/et_pb_column_inner][/et_pb_row_inner][et_pb_row_inner admin_label="Row"][et_pb_column_inner type="1_3" saved_specialty_column_type="3_4"][et_pb_button admin_label="Button" button_url="#comis-direc" url_new_window="off" button_text="Comisión directiva" button_alignment="left" background_layout="light" custom_button="on" button_text_size="14" button_text_color="#ffffff" button_bg_color="#349800" button_border_width="0" button_letter_spacing="0" button_use_icon="off" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0" button_font="|||on|"]\r\n\r\n\r\n\r\n[/et_pb_button][/et_pb_column_inner][et_pb_column_inner type="1_3" saved_specialty_column_type="3_4"][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/contenido/uploads/estatuto.pdf" url_new_window="on" button_text="Descargar Estatuto" button_alignment="left" background_layout="light" custom_button="on" button_text_size="14" button_text_color="#ffffff" button_bg_color="#0080c3" button_border_width="0" button_letter_spacing="0" button_use_icon="off" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0" button_font="|||on|"]\r\n\r\n\r\n\r\n[/et_pb_button][/et_pb_column_inner][et_pb_column_inner type="1_3" saved_specialty_column_type="3_4"][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/asociarse/" url_new_window="off" button_text="Asociarse" button_alignment="left" background_layout="light" custom_button="on" button_text_size="14" button_text_color="#ffffff" button_bg_color="#c50000" button_border_width="0" button_letter_spacing="0" button_use_icon="off" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0" button_font="|||on|" disabled="off" disabled_on="on|on|"]\r\n\r\n\r\n\r\n[/et_pb_button][/et_pb_column_inner][/et_pb_row_inner][/et_pb_column][et_pb_column type="1_4"][et_pb_sidebar admin_label="Sidebar" orientation="right" area="sidebar-1" background_layout="light" disabled="off" disabled_on="on|on|" remove_border="off"]\r\n\r\n\r\n\r\n[/et_pb_sidebar][/et_pb_column][/et_pb_section][et_pb_section admin_label="Section" fullwidth="on" specialty="off" transparent_background="off" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" disabled="off" disabled_on="on|off|" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][et_pb_fullwidth_header admin_label="Fullwidth Header" title="Misión y objetivos" background_layout="dark" text_orientation="center" header_fullscreen="off" header_scroll_down="off" background_url="http://www.redbioargentina.org.ar/contenido/uploads/back-misionyobjetivos.jpg" parallax="off" parallax_method="off" content_orientation="center" image_orientation="center" custom_button_one="off" button_one_letter_spacing="0" button_one_use_icon="default" button_one_icon_placement="right" button_one_on_hover="on" button_one_letter_spacing_hover="0" custom_button_two="off" button_two_letter_spacing="0" button_two_use_icon="default" button_two_icon_placement="right" button_two_on_hover="on" button_two_letter_spacing_hover="0" scroll_down_icon="%%1%%" background_overlay_color="rgba(0,0,0,0.36)" title_font="|||on|" title_font_size="36px" subhead_font_size="24px"]\r\n\r\n\r\n\r\n[/et_pb_fullwidth_header][/et_pb_section][et_pb_section admin_label="Section" fullwidth="off" specialty="off"][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid" disabled="off" disabled_on="|on|on"]\r\n\r\n<h2 class="h2-title">Misión y Objetivos</h2>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="1_2"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title">Visión</h3>\r\n\r\n[/et_pb_text][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p style="text-align: justify;">Construir una organización líder en Argentina que nuclee a instituciones y empresas en biotecnología agrícola con el fin de promover la generación de conocimiento, el desarrollo productivo, el uso racional y sostenible de la biodiversidad, contribuyendo a la modernización e integración de la región en el contexto global, mejorando la calidad de vida de la sociedad en general y de las poblaciones en situación agroalimentaria crítica en particular.</p>\r\n\r\n[/et_pb_text][/et_pb_column][et_pb_column type="1_2"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title">Misión</h3>\r\n\r\n[/et_pb_text][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p style="text-align: justify;">Proporcionar la capacidad, los servicios y el ambiente necesario, como parte del marco de trabajo de la Red REDBIO/FAO, para impulsar, apoyar y ejecutar el desarrollo de programas y proyectos de biotecnología agrícola, integrando a las instituciones líderes, favoreciendo la sinergia entre la Academia, el Gobierno y la Industria y favoreciendo la colaboración y el intercambio de conocimientos con organizaciones internacionales.</p>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title">Objetivos</h3>\r\n\r\n[/et_pb_text][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p style="text-align: justify;">Impulsar el intercambio de conocimientos, tecnología y materiales biológicos entre las instituciones y organizaciones públicas y privadas de los países de América Latina y el Caribe. Fomentar la enseñanza, el estudio, el uso racional y la conservación de la biodiversidad de la región. Favorecer el desarrollo de proyectos de Investigación y Desarrollo entre institutos, laboratorios y empresas de la región, con entidades similares a nivel mundial. Auspiciar la capacitación técnica y generación de recursos humanos calificados a todo nivel en temas de biotecnología vegetal. Asesorar a los gobiernos, organizaciones regionales e internacionales para la consolidación de estrategias de desarrollo en biotecnología vegetal. Promover políticas nacionales y regionales de desarrollo de biotecnología para los sectores productivos y agroindustriales. Obtener contribuciones nacionales e internacionales para cumplir con sus fines.</p>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_divider admin_label="Divider" color="#ffffff" show_divider="off" divider_style="solid" divider_position="top" hide_on_mobile="on"]\r\n\r\n\r\n\r\n[/et_pb_divider][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h2 id="comis-direc" class="h2-title">Comisión directiva</h2>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="1_3"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<strong>Presidente</strong>: Marisa López Bilbao\r\n<strong>Secretaria</strong>: María Patricia Benavides\r\n<strong>Tesorero</strong>: Alejandro Escandón\r\n\r\n<strong>Vocal 1ero</strong>: Dalia Lewi\r\n<strong>Vocal 2do</strong>: Ruth Heinz\r\n<strong>Vocal 3ero</strong>: María Rosa Marano\r\n<strong>Vocal Suplente 1</strong>: Perla Godoy\r\n<strong>Vocal Suplente 2</strong>: Sandra Sharry\r\n\r\n<strong>Fiscal 1ero</strong>: Eleonora Campos\r\n<strong>Fiscal 2do</strong>: Patricia Marconi\r\n<strong>Fiscal 3ero</strong>: Sandra Pitta Alvarez\r\n\r\n[/et_pb_text][/et_pb_column][et_pb_column type="2_3"][et_pb_image admin_label="Image" src="http://www.redbioargentina.org.ar/contenido/uploads/foto-grupal.jpg" show_in_lightbox="off" url_new_window="off" use_overlay="off" animation="left" sticky="off" align="center" disabled="off" disabled_on="on||" force_fullwidth="off" always_center_on_mobile="on" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n\r\n\r\n[/et_pb_image][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section admin_label="Section" fullwidth="on" specialty="off" transparent_background="off" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" disabled="off" disabled_on="on|off|" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][et_pb_fullwidth_header admin_label="Fullwidth Header" title="¿Cómo me asocio a REDBIO?" background_layout="dark" text_orientation="center" header_fullscreen="off" header_scroll_down="off" parallax="off" parallax_method="off" content_orientation="center" image_orientation="center" custom_button_one="off" button_one_letter_spacing="0" button_one_use_icon="default" button_one_icon_placement="right" button_one_on_hover="on" button_one_letter_spacing_hover="0" custom_button_two="off" button_two_letter_spacing="0" button_two_use_icon="default" button_two_icon_placement="right" button_two_on_hover="on" button_two_letter_spacing_hover="0" scroll_down_icon="%%1%%" background_overlay_color="rgba(0,0,0,0)" title_font="|||on|" title_font_size="36px" subhead_font_size="24px" background_color="#c50000" disabled="off" disabled_on="off||"]\r\n\r\n\r\n\r\n[/et_pb_fullwidth_header][/et_pb_section][et_pb_section admin_label="Section" fullwidth="off" specialty="off"][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid" disabled="off" disabled_on="|on|on"]\r\n\r\n<h2 class="h2-title">¿Cómo me asocio a REDBIO?</h2>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p style="text-align: justify;">Aquellos profesionales y/o Instituciones interesados en asociarse a REDBIO Argentina Asociación Civil deberán completar sus datos y abonar la cuota correspondiente según la categoría. Luego deben adjuntar el comprobante en el formulario indicado.</p>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="1_2"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title">Instrucciones:</h3>\r\n<ol>\r\n 	<li>Elija su opción en el cuadro de VALORES arriba transcripto</li>\r\n 	<li>Realice la transferencia bancaria según se detalla más abajo en DATOS BANCARIOS (Los costos de transferencia son a cargo del interesado)</li>\r\n 	<li>Una vez hecha la transferencia bancaria complete el formulario y adjunte el comprobante de pago para poder ser habilitado.</li>\r\n</ol>\r\n\r\n[/et_pb_text][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register/" url_new_window="off" button_text="Registro estudiantes" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0"]\r\n\r\n\r\n\r\n[/et_pb_button][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register/" url_new_window="off" button_text="Registro profesionales" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0"]\r\n\r\n\r\n\r\n[/et_pb_button][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register-instituciones/" url_new_window="off" button_text="Registro instituciones" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_let