r_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h2 id="asociarse" class="h2-title">Asociarse</h2>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p style="text-align: justify;">Aquellos profesionales y/o Instituciones interesados en asociarse a REDBIO Argentina Asociación Civil deberán completar sus datos y abonar la cuota correspondiente según la categoría. Luego deben adjuntar el comprobante en el formulario indicado.</p>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="1_2"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title">Instrucciones</h3>\r\n\r\n[/et_pb_text][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<ol>\r\n 	<li>Elija su opción en el cuadro de CATEGORIAS arriba transcripto</li>\r\n 	<li>Realice la transferencia bancaria según se detalla más abajo en DATOS BANCARIOS (Los costos de transferencia son a cargo del interesado)</li>\r\n 	<li>Es necesario realizar primero la transferencia ya que el comprobante de pago debe ser incluido en el formulario como requisito.</li>\r\n</ol>\r\n\r\n[/et_pb_text][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register/" url_new_window="off" button_text="Registro estudiantes" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0"]\r\n\r\n\r\n\r\n[/et_pb_button][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register/" url_new_window="off" button_text="Registro profesionales" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0"]\r\n\r\n\r\n\r\n[/et_pb_button][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register-instituciones/" url_new_window="off" button_text="Registro instituciones" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0"]\r\n\r\n\r\n\r\n[/et_pb_button][/et_pb_column][et_pb_column type="1_2"][et_pb_accordion admin_label="Accordion" toggle_font="|on||on|" use_border_color="off" border_color="#ffffff" border_style="solid" toggle_font_size="14" saved_tabs="all"]\r\n\r\n[et_pb_accordion_item title="Categorías"]\r\n\r\nProfesional: $ 400.-\r\nEstudiante (grado y post-grado): $300.-\r\nEstudiante de Post-grado: $300.-\r\n\r\n[/et_pb_accordion_item][et_pb_accordion_item title="Datos Bancarios"]\r\n<p style="text-align: justify;"><span class="normalTxt">REDBIO DE ARGENTINA ASOCIACION CIVIL\r\n</span><span class="bold">Cuenta Banco Provincia de Buenos Aires\r\n</span><span class="normalTxt"><strong>Suc. Morón</strong>\r\nCta Cte Nro 0504243\r\nSucursal 05098\r\nCBU .0140030-4 0150980504243-9\r\nCUIT de REDBIO Argentina 30-70993694-4</span>\r\n\r\n[/et_pb_accordion_item][et_pb_accordion_item title="Transferencia desde el exterior"]\r\n<p style="text-align: justify;">Para Instrucciones para Transferencias desde el exterior\r\ncontactar a <a href="http://www.bapro.com.ar/" target="_blank">Banco de la Provincia de Buenos Aires</a>.\r\n\r\n[/et_pb_accordion_item][et_pb_accordion_item title="Blanqueo de clave"]\r\n\r\nPara blanqueo de clave haga clic <a href="http://www.redbioargentina.org.ar/password-reset/">aquí</a>.\r\n\r\n[/et_pb_accordion_item]\r\n\r\n[/et_pb_accordion][/et_pb_column][/et_pb_row][/et_pb_section][et_pb_section admin_label="Section" fullwidth="on" specialty="off" transparent_background="off" allow_player_pause="off" inner_shadow="off" parallax="off" parallax_method="off" padding_mobile="off" disabled="off" disabled_on="on|on|" make_fullwidth="off" use_custom_width="off" width_unit="on" make_equal="off" use_custom_gutter="off"][et_pb_fullwidth_header admin_label="Fullwidth Header" title="Renovación cuota anual" background_layout="dark" text_orientation="center" header_fullscreen="off" header_scroll_down="off" parallax="off" parallax_method="off" content_orientation="center" image_orientation="center" custom_button_one="off" button_one_letter_spacing="0" button_one_use_icon="default" button_one_icon_placement="right" button_one_on_hover="on" button_one_letter_spacing_hover="0" custom_button_two="off" button_two_letter_spacing="0" button_two_use_icon="default" button_two_icon_placement="right" button_two_on_hover="on" button_two_letter_spacing_hover="0" scroll_down_icon="%%1%%" background_overlay_color="rgba(0,0,0,0.01)" title_font="|||on|" title_font_size="36px" subhead_font_size="24px" background_color="#c50000"]\r\n\r\n&nbsp;\r\n\r\n[/et_pb_fullwidth_header][/et_pb_section][et_pb_section admin_label="section"][et_pb_row admin_label="row" make_fullwidth="off" use_custom_width="off" width_unit="on" use_custom_gutter="off" padding_mobile="off" allow_player_pause="off" parallax="off" parallax_method="off" make_equal="off" parallax_1="off" parallax_method_1="off" column_padding_mobile="on"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="center" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h2 id="renovacion" class="h2-title">Renovación</h2>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="4_4"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p style="text-align: justify;">Aquellos profesionales y/o Instituciones interesados en asociarse a REDBIO Argentina Asociación Civil deberán completar sus datos y abonar la cuota correspondiente según la categoría. Luego deben enviar el comprobante a esta dirección de email:</p>\r\n\r\ninfo@redbioargentina.org.ar\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][et_pb_row admin_label="Row"][et_pb_column type="1_2"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title tipo-en-rojo">Categorías</h3>\r\n\r\n[/et_pb_text][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<span class="tipo-en-rojo">Profesional: $ 400.-\r\nEstudiante (grado y post-grado): $300.-\r\nEstudiante de Post-grado: $300.-</span>\r\n\r\n[/et_pb_text][/et_pb_column][et_pb_column type="1_2"][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title tipo-en-azul">Importante</h3>\r\n\r\n[/et_pb_text][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<p style="text-align: justify;"><span class="tipo-en-azul">Recuerde que su dirección de email es su clave de identificación en nuestra base de datos. Sería bueno enviar el comprobante desde la misma dirección o aclarar su usuario y email cuando nos escriba.</span></p>\r\n\r\n[/et_pb_text][/et_pb_column][/et_pb_row][/et_pb_section]', 'asociarse', '', 'publish', 'closed', 'closed', '', 'asociarse', '', '', '2016-10-25 22:02:24', '2016-10-26 01:02:24', '', 0, 'http://www.redbioargentina.org.ar/?page_id=94', 0, 'page', '', 0),
