.0140030-4 0150980504243-9 CUIT de REDBIO Argentina 30-70993694-4</span></p>\r\n[/et_pb_accordion_item][et_pb_accordion_item title="Transferencia desde el exterior"]\r\n<p style="text-align: justify;">Para Instrucciones para Transferencias desde el exterior contactar a <a href="http://www.bapro.com.ar/" target="_blank">Banco de la Provincia de Buenos Aires</a>.</p>\r\n[/et_pb_accordion_item][et_pb_accordion_item title="Blanqueo de clave"]\r\n<p>Para blanqueo de clave haga clic <a href="http://www.redbioargentina.org.ar/password-reset/">aquí</a>.</p>\r\n[/et_pb_accordion_item]\r\n\r\n[/et_pb_accordion][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\r\n\r\n<h3 class="h3-title tipo-en-rojo">Categorías:</h3>\r\n<p><span style="color: #c50000;">Profesional: $ 400.-</span><br />\r\n<span style="color: #c50000;">Estudiante (grado y post-grado): $300.-<br />\r\n</span><span style="color: #c50000;">Estudiante de Post-grado: $300.-</span></p>\r\n<p><em><strong>Deberá adjuntar el comprobante de pago en este formulario.</strong></em></p>\r\n\r\n[/et_pb_text][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register/" url_new_window="off" button_text="Registro profesionales" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0"]\r\n\r\n<br />\r\n\r\n[/et_pb_button][/et_pb_column][/et_pb_row][/et_pb_section]', 'register-instituciones', '', 'publish', 'closed', 'closed', '', 'register-instituciones', '', '', '2016-10-02 23:02:21', '2016-10-03 02:02:21', '', 0, 'http://www.redbioargentina.org.ar/?page_id=129', 0, 'page', '', 0),
