a Transferencias desde el exterior contactar a <a href="http://www.bapro.com.ar/" target="_blank">Banco de la Provincia de Buenos Aires</a>.</p>\n[/et_pb_accordion_item]\n\n[/et_pb_accordion][et_pb_text admin_label="Text" background_layout="light" text_orientation="left" use_border_color="off" border_color="#ffffff" border_style="solid"]\n\n<h3 class="h3-title tipo-en-rojo">Categorías:</h3>\n<span style="color: #c50000;">Profesional: $ 400.-</span>\n<span style="color: #c50000;">Estudiante (grado y post-grado): $300.-\n</span><span style="color: #c50000;">Estudiante de Post-grado: $300.-</span>\n\n<em><strong>Deberá adjuntar el comprobante de pago en este formulario.</strong></em>\n\n[/et_pb_text][et_pb_button admin_label="Button" button_url="http://www.redbioargentina.org.ar/register/" url_new_window="off" button_text="Registro profesionales" button_alignment="left" background_layout="light" custom_button="on" button_text_size="16" button_text_color="#c50000" button_bg_color="rgba(255,255,255,0)" button_border_width="1" button_border_color="#c50000" button_letter_spacing="0" button_font="|||on|" button_use_icon="default" button_icon_placement="right" button_on_hover="on" button_letter_spacing_hover="0"]\n\n\n\n[/et_pb_button][/et_pb_column][/et_pb_row][/et_pb_section]', 'registro-pagina', '', 'publish', 'closed', 'closed', '', 'registro-pagina', '', '', '2016-09-30 17:56:51', '2016-09-30 20:56:51', '', 0, 'http://www.redbioargentina.org.ar/et_pb_layout/registro-pagina/', 0, 'et_pb_layout', '', 0);
