(628, 'sabrinamoyano_9@hotmail.com', 'Sabrina', 'Moyano', '1987-11-04', '', 'NO', 'Analisis genomico de un nuevo aislamiento de Grapevine leafroll associated virus 2 con com', '', '', '', '', 'Ingenieria genetica', 'Biologia molecular', 'Virologia', '542614963020', '', 'Virus', 'Vid', 'Secuenciacion', 'PRET 1251101Desarrollo territorial del Oasis Norte de\r\nMendoza.\r\nPE1131022 Genomica funcional y Biologia de sistemas.\r\nPICT 2012-0396 caracterizacion del efecto de GLRaV-2 sobre parametros fisiologicos del cv Malbec y su impacto en la calidad de la produccion.\r\nPE1131023 Prospeccion y caracterizacion funcional de genes de interes biotecnologicos'),
(629, 'mlv2617@gmail.com', 'Melisa', 'Lanza Volpe', '1981-06-20', '', 'NO', 'Caracterizacion genetica y molecular de la interaccion planta-platogeno entre Nicotiana sp', '', '', 'Licenciada en Biologia Molecular', '', 'Biologia molecular', 'Genomica', 'Virologia', '542614963020', '', 'virus', 'vid', 'expresion genica', 'PE1131022 Genomica funcional y biologia de sistemas \r\nPICT 2012-0396 Caracterizacion del efecto de GLRaV-2 sobre parametros fisiologicos del cv. Malbec y su impacto en la calidad de la produccion\r\nPE1131023 Prospeccion y caracterizacion funcional de genes de interes biotecnologico\r\nProyecto INTA-Audeas CIAC-940118\r\nFactores bioticos y abioticos que afectan la productividad del cultivo de la Vid\r\nPNPV 1135024 Defensa en plantas contra fitopatogenos '),
(630, 'sonia.wirth@gmail.com', 'Sonia Alejandra', 'Wirth', '1974-03-19', '', 'NO', 'Bioprospeccion de enzimas industriales en hongos basidiomicetes', '', '', 'Licenciada en Ciencias Biologicas', 'Doctor de la Universidad de Buenos Aires', 'Ingenieria genetica', 'Biologia molecular', 'Biotecnologia industrial', '1551122772', '', 'Bioprospeccion', 'Bioetanol', 'Hongos Basidiomicete', '1	Clonado y caracterizacion de las lacasas de hongos basidiomicetes de la pudricion blanca. \r\nUtilizando oligonucleotidos que reconocen secuencias conservadas en las lacasas fenol oxidasas fungicas y las tecnicas de 5RACE y 3RACE PCR realizamos el clonado de cuatro isoenzimas de Trametes trogii BAFC 463 y una de Grammothele subargentea LPSC No. 436. Estas secuencias fueron clonadas y expresadas en la levadura Pichia pastoris a fin de realizar su caracterizacion y evaluacion de su capacidad degradativa de colorantes textiles. \r\nProyecto en colaboracion con el Laboratorio de Micologia Experimental DBBE-FCEyN-UBA PROPLAME-PRHIDEB-CONICET Trametes trogii y con el Dr Mario Saparrat Facultad de Ciencias Naturales y Museo Instituto de Botanica Spegazzini Universidad Nacional de La Plata UNLP Grammothele subargentea.\r\n\r\n2	Bioprospeccion in silico de enzimas lignoceluloliticas en hongos de la pudricion blanca.\r\nUtilizando la tecnica de pirosecuenciacion 454 realizamos la secuenciacion del transcriptoma de Pycnoporus sanguineus BAFC 2126 seleccionado por su capacidad para delignificar chips de madera de pino y como productor de compuestos antioxidantes y aromatizantes asi como antibioticos y antivirales. El ensamblado y analisis de las 89 millones de bases secuenciadas nos permitio identificar y anotar 7303 transcriptos para este hongo de los cuales mas de 100 codifican enzimas de interes biotecnologico. Actualmente estas secuencias se encuentran disponibles en la base de datos del NCBI accession GAKI01000000 httpwww.ncbi.nlm.nih.govnuccoreGAKI00000000.1 sequences GAKI01000001-GAKI01007303. \r\nProyecto en colaboracion con el Laboratorio de Micologia Experimental DBBE-FCEyN-UBA PROPLAME-PRHIDEB-CONICET y con el Lic Cristian Rhor Laboratorio de Agrobiotecnologia FCEN-UBA.\r\n\r\n3	Mejoramiento de la digestibilidad de especies forrajeras mediante la expresion de  enzimas modificadoras de lignina. \r\nEnsayamos la expresion de una lacasa fungica bajo el control de un promotor de senescencia o mediante su compartimentalizacion en vacuolas a fin de desarrollar plantas con mejor calidad nutritiva para el ganado.\r\nProyecto parte del Consorcio Asociativo Publico-Privado PasArg httpwww.pasarg.com financiado por el Fondo Argentino Sectorial FONARSEC FSBIO 2010 Agrobiotecnologia.\r\n\r\n4	Uso de plantulas de Arabidopsis thaliana como sistema de expresion de proteinas recombinantes. \r\nProponemos un sistema de produccion de proteinas heterologas controlado y de alta expresion utilizando promotores inducidos por pulsos de luz en plantulas de A. thaliana.\r\nProyecto en colaboracion con el Dr. Pablo Cerdan Laboratorio de Biologia Molecular de Plantas Fundacion Instituto Leloir.\r\n\r\n5	Produccion de los factores mLIF y mBMP4 moduladores de la plasticidad celular en celulas madre embrionarias en Pichia pastoris.\r\nPlanteamos la utilizacion de Pichia pastoris como un sistema para la produccion de factores de diferenciacion celular para su utilizacion in vitro en celulas de mamifero pluripotentes. De esta manera planeamos poder de suministrar una fuente alternativa y economica de reactivos basicos para los laboratorios de investigacion en celulas madre.\r\nProyecto en colaboracion con la Dra. Carolina Perez Castro Instituto de Investigacion en Biomedicina de Buenos Aires IBioBA-CONICET.\r\n\r\n6	Inmovilizacion de lacasas en matrices de alginato. \r\nA fin de realizar una aproximacion para la formulacion de lacasas para el tratamiento de efluentes estamos ensayando la inmovilizacion en matrices de alginato de las lacasas de Trametes trogii producidas en Pichia pastoris.\r\nProyecto en colaboracion con el Laboratorio de Superficies y Materiales Funcionales INQUIMAE-CONICET.\r\n'),
